          style={{
            display:"grid",
            gridTemplateColumns:"repeat(auto-fill, minmax(300px,1fr)",
            gap:"1rem",
            alignItems:"flex-start",
          }}
        >
          <budgetcard>name:"Entertainment</budgetcard>
        </div>
    </Container>
  )
}

export default App;
